#
# Structure for table "adv"
#

DROP TABLE IF EXISTS `adv`;
CREATE TABLE `adv` (
  `id` bigint(20) unsigned NOT NULL COMMENT '主键',
  `gmt_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status_id` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态(1:正常，0:禁用)',
  `sort` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '排序',
  `adv_title` varchar(255) NOT NULL COMMENT '广告标题',
  `adv_img` varchar(255) NOT NULL DEFAULT '' COMMENT '广告图片',
  `adv_url` varchar(255) NOT NULL COMMENT '广告链接',
  `adv_target` varchar(255) NOT NULL DEFAULT '' COMMENT '广告跳转方式',
  `adv_location` tinyint(3) NOT NULL DEFAULT '1' COMMENT '广告位置(1首页轮播)',
  `begin_time` datetime NOT NULL COMMENT '开始时间',
  `end_time` datetime NOT NULL COMMENT '结束时间',
  `plat_show` tinyint(3) NOT NULL DEFAULT '0' COMMENT '位置(0电脑端，1微信端)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='广告信息';

