#
# Structure for table "course"
#

DROP TABLE IF EXISTS `course`;
CREATE TABLE `course` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `gmt_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status_id` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态(1:正常，0:禁用)',
  `sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `lecturer_user_no` bigint(20) NOT NULL DEFAULT '0' COMMENT '讲师用户编码',
  `category_id1` bigint(20) DEFAULT '0' COMMENT '一级分类ID',
  `category_id2` bigint(20) DEFAULT '0' COMMENT '二级分类ID',
  `category_id3` bigint(20) DEFAULT '0' COMMENT '三级分类ID',
  `course_name` varchar(255) NOT NULL DEFAULT '' COMMENT '课程名称',
  `course_logo` varchar(255) NOT NULL DEFAULT '' COMMENT '课程封面',
  `introduce_id` bigint(20) DEFAULT '0' COMMENT '课程介绍ID',
  `is_free` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否免费：1免费，0收费',
  `course_original` decimal(11,2) DEFAULT NULL COMMENT '原价',
  `course_discount` decimal(11,2) DEFAULT NULL COMMENT '优惠价',
  `is_putaway` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否上架(1:上架，0:下架)',
  `course_sort` int(11) NOT NULL DEFAULT '0' COMMENT '课程排序(前端显示使用)',
  `count_buy` int(11) NOT NULL DEFAULT '0' COMMENT '购买人数',
  `count_study` int(11) NOT NULL DEFAULT '0' COMMENT '学习人数',
  `period_total` int(11) NOT NULL DEFAULT '0' COMMENT '总课时数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='课程信息';

