INSERT INTO `course_introduce` VALUES (1080756535550480385,'2019-01-03 17:23:30','2019-01-03 17:23:30','<p>项目地址：</p><p><a href=\"http://git.oschina.net/roncoocom/roncoo-adminlte-springmvc\">龙果开源-后台管理系统</a>&nbsp;<a href=\"http://git.oschina.net/roncoocom/roncoo-adminlte-springmvc\">http://git.oschina.net/roncoocom/roncoo-adminlte-springmvc</a></p><p><strong>技术交流群：546588570</strong></p><p><br></p><p>项目介绍</p><p>1. 框架完全是基于Spring IO platform，绝对拥抱Spring，版本的依赖关系再不用担心。&nbsp;<br>2. 前端基于&nbsp;<a href=\"https://github.com/roncoo/roncoo-adminLTE/\">龙果开源-后台管理UI Roncoo AdminLTE</a>，高端大气上档次。&nbsp;<br>3. 实现了邮件发送功能，邮件增删改查功能&nbsp;<br>4. 代码自动生成工具使用了&nbsp;<a href=\"https://github.com/roncoo/roncoo-mybatis-generator\">龙果开源-Mybatis代码自动生成工具</a>&nbsp;<br><br>项目愿景&nbsp;<br>根据实际项目的需求，实现一个适合由单应用扩展到多应用的架构。在项目的最初设定就是一个适合多模块扩展的架构，最初是单应用架构，以包区分模块。当项目需求增大的时候，会先实现多机部署，接下来进行项目拆分，进行集群部署。每个阶段都会整合一个架构，提供对应的解决方案。&nbsp;<br><br>技术框架&nbsp;<br>* 核心框架：Spring Framework&nbsp;<br>* 视图框架：Spring MVC&nbsp;<br>* 模板引擎：Freemark&nbsp;<br>* 持久层框架：Mybatis&nbsp;<br>* 数据库连接池：Alibaba Druid&nbsp;<br></p><p><br></p><p>目前最新集成功能：</p><p>使用shiro集成权限模块</p><p>集成Spring Session，解决了单节点问题</p><p><br></p><p>下步计划&nbsp;<br>继续优化，持续更新，增加各种demo实例&nbsp;<br>创建maven原型，实现快捷搭建项目架构&nbsp;&nbsp;&nbsp;<br></p>'),(1080758482454122498,'2019-01-03 17:31:14','2019-01-03 17:31:14','<p>龙果运维系统：基于cobbler的二次开发，方便不会的机房和运维人员快速装机，CMDB的快速添加，CMDB机柜平台，机柜和故障告警展示，zabbix 的模板管理，把CMDB同步到zabbix 数据库，然后批量绑定模板，删除维护周期，zabbix调用图片运维平台生成图形；后期更新基于saltstack 构建自动化扩容平台生态。</p><p><br></p><p>龙果运维平台开源地址：<a href=\"https://github.com/roncoo/roncoo-cmdb\">https://github.com/roncoo/roncoo-cmdb</a></p><p></p><p>Zabbix3.0入门到生产环境应用实战：</p><p><a href=\"http://www.roncoo.com/course/view/fb3050a5b34b42f39ccad83ebebc89c1\">http://www.roncoo.com/course/view/fb3050a5b34b42f39ccad83ebebc89c1</a></p><p><br></p>'),(1080759102695215105,'2019-01-03 17:33:42','2019-01-03 17:33:42','<p>龙果支付系统是国内首款开源的互联网支付系统，其核心目标是汇聚所有主流支付渠道，打造一款轻量、便捷、易用，且集支付、资金对账、资金清结算于一体的支付系统，满足互联网业务系统的收款和业务资金管理需求。&nbsp;<br><br>主要特点：&nbsp;<br>具备支付系统通用的支付、对账、清算、资金账户管理、支付订单管理等功能；&nbsp;<br>目前已接通“支付宝即时到账”和“微信扫码支付”通道；&nbsp;<br>支持直连和间连两种支付模式，任君选择；&nbsp;<br>通过支付网关，业务系统可以轻松实现统一支付接入；&nbsp;<br>搭配运营后台，支付数据的监控和管理可以兼得；&nbsp;<br>配套完善的系统使用文档，可轻松嵌入任何需要支付的场景；&nbsp;<br></p><p>龙果支付系统产品技术团队是一支拥有多年第三方支付系统设计研发经验的团队，会为龙果支付系统持续提供商业级的免费开源技术服务支持。</p><p><br></p><p>支付业务流程中所遇到的分布式事务问题可以参考：<a href=\"http://www.roncoo.com/article/detail/124243\">《微服务架构的分布式事务解决方案》</a></p><p><img alt=\"\" src=\"http://img.roncoo.com/education/course/2016/09_01/img/ba76a876e3ec4937bac9a66e6b710bb8.jpg\"></p><p>开源中国地址：<a href=\"http://www.oschina.net/p/roncoo-pay\">http://www.oschina.net/p/roncoo-pay</a></p><p><a href=\"http://git.oschina.net/roncoocom/roncoo-pay\">http://git.oschina.net/roncoocom/roncoo-pay</a></p><p>GitHub地址：<a href=\"https://github.com/roncoo/roncoo-pay\">https://github.com/roncoo/roncoo-pay</a></p><p>在线支付演示：<a href=\"http://demo.pay.roncoo.com/\">http://demo.pay.roncoo.com</a><br>后台运营管理：<a href=\"http://demo.pay.roncoo.com/boss\">http://demo.pay.roncoo.com/boss</a><br>系统操作说明：<a href=\"http://www.roncoo.com/article/detail/124375\">http://www.roncoo.com/article/detail/124375</a><br>系统详细介绍：<a href=\"http://www.roncoo.com/article/detail/124373\">http://www.roncoo.com/article/detail/124373</a><br>系统搭建部署：<a href=\"http://www.roncoo.com/article/detail/124511\">http://www.roncoo.com/article/detail/124511</a><br>官方QQ群：597865269 欢迎加入，共同探讨互联网金融支付行业业务、技术等</p><p>=============================================================</p><p>注：龙果支付系统也有商业版，商业版龙果支付系统是一套支付金融行业通用的支付系统，拥有独立的账户体系、用户体系、支付交易体系、代理分润体系、对账清结算体系。可以作为独立的运营的支付平台，接入各种银行通道或第三方支付通道，为下游商户或平台提供一站式支付业务应用解决方案；也可为电商、金融、保险、教育、医疗、交通等行业提供统一的支付业务接入和账户管理，实现业务平台统一的收款、结算、财务资金管理等功能。</p><p><strong>项目合作</strong></p><p><strong>联系人：吴老师（吴水成）<br>QQ：840765167&nbsp;<br></strong></p><p><strong>微信：wushuicheng</strong></p><p><strong>邮箱：wusc@roncoo.com</strong></p><p><strong><br></strong></p>'),(1080759557651369985,'2019-01-03 17:35:31','2019-01-03 17:35:31','<p>领课教育系统是广州市领课网络科技有限公司自主研发的一套各行业通用的在线教育系统软件，适用于垂直行业职业技能培训、企业内训、K12教育、知识付费内容平台等所有需要实现在线教育的应用场景。 系统拥有完善的在线教学功能，良好的用户体验，先进的技术架构，帮助教育机构或企业搭建一个高质量且自主可控的在线教育平台。</p><p><br></p><div><p>完善的在线教学功能：录播、直播、题库、资源、社区、营销、博客等</p></div><div><p>全面的系统技术交付：提供全套教育系统的程序源码、文档、脚本</p></div><div><p>体系化的培训指导：使用培训、代码及技术架构培训、部署培训、扩展开发指导等</p></div><div><p>灵活的定制化方案：可根据企业自身需求进行定制化功能开发</p><p><br></p><p>官网：<a href=\"https://edu.roncoo.net/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">领课教育系统(https://edu.roncoo.net/)</a><br></p><p><br></p></div>'),(1085453180192059393,'2019-01-16 16:26:18','2019-01-16 16:26:18','<p></p>\n<p></p>\n<p></p>\n<p>该课程仅用于测试购买！</p><p><br></p>'),(1246446673559326721,'2020-04-04 22:36:59','2020-04-04 22:36:59','<p><ajavascript:\">龙果代码生成&nbsp;&nbsp;</ajavascript:\"><br></p><p><ajavascript:\"><br></ajavascript:\"></p>'),(1248473637711302658,'2020-04-10 12:51:25','2020-04-10 12:51:25','<p>龙果教程项目</p><p><br></p>'),(1248882669789958146,'2020-04-11 15:56:46','2020-04-11 15:56:46','<p>龙果集成项目</p><p><br></p>'),(1249286274741227521,'2020-04-12 18:40:33','2020-04-12 18:40:33','<p>龙果充值系统</p><p><br></p>');

