#
# Structure for table "order_info"
#

DROP TABLE IF EXISTS `order_info`;
CREATE TABLE `order_info` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `gmt_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `lecturer_user_no` bigint(20) NOT NULL COMMENT '讲师用户编号',
  `lecturer_name` varchar(50) NOT NULL COMMENT '讲师名称',
  `user_no` bigint(20) NOT NULL COMMENT '用户编号',
  `mobile` varchar(11) NOT NULL COMMENT '用户电话',
  `register_time` datetime DEFAULT NULL COMMENT '用户注册时间',
  `order_no` bigint(20) NOT NULL COMMENT '订单号',
  `course_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '课程ID',
  `course_name` varchar(50) NOT NULL COMMENT '课程名称',
  `price_payable` decimal(11,2) DEFAULT NULL COMMENT '应付金额',
  `price_discount` decimal(11,2) DEFAULT NULL COMMENT '优惠金额',
  `price_paid` decimal(11,2) DEFAULT NULL COMMENT '实付金额',
  `platform_profit` decimal(11,2) DEFAULT NULL COMMENT '平台收入',
  `lecturer_profit` decimal(11,2) DEFAULT NULL COMMENT '讲师收入',
  `trade_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '交易类型：1线上支付，2线下支付',
  `pay_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '支付方式：1微信支付，2支付宝支付',
  `channel_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '购买渠道：1web',
  `order_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '订单状态：1待支付，2成功支付，3支付失败，4已关闭',
  `is_show_lecturer` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示给讲师(1是，0否)',
  `is_show_user` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示给用户看(1是，0否)',
  `remark_cus` varchar(255) DEFAULT NULL COMMENT '客户备注',
  `remark` varchar(255) DEFAULT NULL COMMENT '后台备注',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_order_no` (`order_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='订单信息表';

#
