#
# Structure for table "zone"
#

DROP TABLE IF EXISTS `zone`;
CREATE TABLE `zone` (
  `id` bigint(20) NOT NULL COMMENT '主键',
  `gmt_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status_id` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态(1:正常;0:禁用)',
  `sort` int(11) NOT NULL DEFAULT '1' COMMENT '排序',
  `zone_name` varchar(50) NOT NULL DEFAULT '' COMMENT '名称',
  `zone_desc` varchar(255) DEFAULT NULL COMMENT '描述',
  `zone_location` tinyint(3) NOT NULL DEFAULT '0' COMMENT '位置(0电脑端，1微信端)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='专区';

